import React from 'react'

import fexportada from '../../store/prueba/reducer'
import {lePinchoElCarnal} from '../../store/prueba/action'
import { connect } from 'react-redux'

const Prueba = ({lePinchoElCarnal}) =>{
    console.log(prueba())
    return(
        <div>
            <button onClick={()=>lePinchoElCarnal()}>Pinchale aqui carnal!!</button>
        </div>
    )
}

const prueba = ({interruptor}) =>{
    return interruptor
}
const mapStateToProps = (state)=>{
    return{
        interruptor: fexportada(state)
    }
}

export default connect(mapStateToProps, {lePinchoElCarnal})(Prueba)
